import React, { useEffect } from "react";
import styles from './Scroll.module.scss';

export const Scroll = () => {

    useEffect(() => {
        const header = document.querySelector(`.${styles.header}`);
        const headerTitle = document.querySelector(`.${styles.headerTitle}`);

        const handleMouseMove = (e) => {
            const xRelativeToHeader = e.clientX / header.clientWidth;
            const yRelativeToHeader = e.clientY / header.clientHeight;

            if (headerTitle) {
                headerTitle.style.transition = 'transform 0s'; // Disable transition during movement
                headerTitle.style.transform = `translate(${xRelativeToHeader * -50}px, ${yRelativeToHeader * -50}px)`;
            }
        };

        const handleMouseLeave = () => {
            if (headerTitle) {
                headerTitle.style.transition = 'transform 0.5s ease-in-out'; // Re-enable transition on mouse leave
                headerTitle.style.transform = 'translate(0, 0)';
            }
        };

        if (header) {
            header.addEventListener("mousemove", handleMouseMove);
            header.addEventListener("mouseleave", handleMouseLeave);
        }

        // Cleanup the event listeners when the component unmounts
        return () => {
            if (header) {
                header.removeEventListener("mousemove", handleMouseMove);
                header.removeEventListener("mouseleave", handleMouseLeave);
            }
        };
    }, []); // Empty dependency array ensures this effect runs once on mount

    return (
        <div className={styles.container}>

            <div className={styles.header}>
                <p className={styles.headerTitle}>travel rate</p>
                <img className={styles.downArrow} src="/exchange/down.svg" alt="down_icon" />
            </div>
            <br />

            <div>
                <p>트래블 레이트와 함께라면</p>
                <p>여행이 현명해집니다.</p>
            </div>
            <br />

            <div>
                <img src="" alt="airplane" />
            </div>
            <br />

            <div>
                <div>
                    <p>똑똑한 소비자를 위한</p>
                    <p>가성비 여행지 추천</p>
                </div>
                <br />

                <div>
                    <img src="" alt="currency" />
                    <p>지원통화</p>
                    <p>23개</p>
                </div>
                <br />

                <div>
                    <img src="" alt="card" />
                    <p>카드추천</p>
                    <p>평균 30종 이상</p>
                </div> 
                <br />

                <div>
                    <img src="" alt="exchange" />
                    <p>원하는 환율에 환전이 가능하도록,</p>
                    <p>알림 서비스</p>
                </div>
                <br />
            </div>

            <div>
                <img src="" alt="destination" />
                <p>지금 현재 가기 좋은 여행지 추천받고,</p>
                <p>빠르게 여행계획 세우자!</p>
            </div>
            <br />

            <div>
                <img src="" alt="card-recommendation" />
                <p>여행지 환율 우대받을 수 있는 카드 추천받고,</p>
                <p>몰랐던 혜택 누리자!</p>
            </div>
            <br />

            <div>
                <img src="" alt="alert" />
                <p>알림받고 내가 정한 환율대로</p>
                <p>현명한 여행계획 세우자!</p>
            </div>
            <br />

        </div>
    );
};
